import React, { useEffect, useState } from "react";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [error, setError] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      console.log("Fetching with token:", token);

      try {
        const response = await fetch(
          "https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list",
          {
            method: "POST", // changed to POST
            headers: {
              "Content-Type": "application/json",
              APPID: "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
            body: JSON.stringify({}) // required for POST
          }
        );

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
          setError(data.msg || "Failed to fetch doctor list");
        }
      } catch (error) {
        console.error("Error fetching doctor list:", error);
        setError("Error fetching doctor list.");
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      setError("No token found. Please log in again.");
    }
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>

      {error && <p className="text-red-500">{error}</p>}

      {doctors.length === 0 && !error ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <ul className="space-y-2">
          {doctors.map((doc, index) => (
            <li key={index} className="p-3 border rounded shadow">
              {doc.name || doc.doctor_name || doc.full_name || "No Name"} -{" "}
              {doc.speciality || doc.specialty || "No Speciality"}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default DoctorList;
